import React, { useState } from "react";
import universityData from "./UniversityData";
import jsPDF from "jspdf";
import "jspdf-autotable";

function App() {
  const [selectedUniversity, setSelectedUniversity] = useState(universityData[0]);
  const [selectedSubject, setSelectedSubject] = useState(universityData[0].subjects[0]);
  const [selectedProgram, setSelectedProgram] = useState("Masters");

  const selectedSubjectData =
    selectedUniversity?.subjectDetails?.[selectedSubject]?.[selectedProgram];

  const generatePDF = () => {
    const doc = new jsPDF();
    doc.text(`${selectedUniversity.name} - ${selectedSubject} (${selectedProgram})`, 10, 10);
    doc.autoTable({
      startY: 20,
      head: [["Year", "QS Subject Rank", "GPA Cutoff", "SAT Cutoff"]],
      body: selectedSubjectData?.qsRankingsOverYears?.map((entry) => [
        entry.year,
        entry.qsRank,
        entry.gpaCutoff,
        entry.satCutoff,
      ]),
    });
    doc.save(`${selectedUniversity.name}_${selectedSubject}_${selectedProgram}.pdf`);
  };

  return (
    <div style={{ padding: "20px", fontFamily: "Arial, sans-serif" }}>
      <h2>QS University Rankings App</h2>

      <div>
        <label>
          Select University:
          <select
            value={selectedUniversity.name}
            onChange={(e) => {
              const uni = universityData.find((u) => u.name === e.target.value);
              setSelectedUniversity(uni);
              setSelectedSubject(uni.subjects[0]);
              setSelectedProgram("Masters");
            }}
          >
            {universityData.map((uni, index) => (
              <option key={index} value={uni.name}>
                {uni.name}
              </option>
            ))}
          </select>
        </label>

        <label style={{ marginLeft: "20px" }}>
          Select Subject:
          <select
            value={selectedSubject}
            onChange={(e) => setSelectedSubject(e.target.value)}
          >
            {selectedUniversity.subjects.map((subj, index) => (
              <option key={index} value={subj}>
                {subj}
              </option>
            ))}
          </select>
        </label>

        <label style={{ marginLeft: "20px" }}>
          Select Program:
          <select
            value={selectedProgram}
            onChange={(e) => setSelectedProgram(e.target.value)}
          >
            {selectedUniversity.programs.map((prog, index) => (
              <option key={index} value={prog}>
                {prog}
              </option>
            ))}
          </select>
        </label>
      </div>

      <hr />

      <h3>
        {selectedSubject} – {selectedProgram} Program
      </h3>

      <p>
        <strong>QS Subject Rank:</strong>{" "}
        {selectedSubjectData?.qsRankingsOverYears?.[0]?.qsRank || "N/A"}
      </p>

      <p>
        <strong>Start Date:</strong> {selectedSubjectData?.startDate || "N/A"}
      </p>

      <p>
        <strong>Tuition Fees:</strong><br />
        International: {selectedSubjectData?.fees?.International || "N/A"}<br />
        Domestic: {selectedSubjectData?.fees?.Domestic || "N/A"}
      </p>

      <p>
        <strong>Eligibility:</strong><br />
        International: {selectedSubjectData?.eligibility?.International || "N/A"}<br />
        Domestic: {selectedSubjectData?.eligibility?.Domestic || "N/A"}
      </p>

      <p>
        <strong>Course Link:</strong>{" "}
        <a href={selectedSubjectData?.courseLink} target="_blank" rel="noopener noreferrer">
          View Course Page
        </a>
      </p>

      <hr />

      <h4>QS Subject Rankings & Admission Benchmarks (Past 5 Years)</h4>

      <table border="1" cellPadding="8" style={{ borderCollapse: "collapse", width: "100%" }}>
        <thead>
          <tr>
            <th>Year</th>
            <th>QS Subject Rank</th>
            <th>
              GPA Cutoff<br />
              <small>(Approximate admission benchmark – not an official cutoff)</small>
            </th>
            <th>
              SAT Cutoff<br />
              <small>(Approximate admission benchmark – not an official cutoff)</small>
            </th>
          </tr>
        </thead>
        <tbody>
          {selectedSubjectData?.qsRankingsOverYears?.map((entry, index) => (
            <tr key={index}>
              <td>{entry.year}</td>
              <td>{entry.qsRank}</td>
              <td>{entry.gpaCutoff}</td>
              <td>{entry.satCutoff}</td>
            </tr>
          ))}
        </tbody>
      </table>

      <button onClick={generatePDF} style={{ marginTop: "20px" }}>
        Download as PDF
      </button>
    </div>
  );
}

export default App;
